"use strict";function initialize(){var n=new google.maps.LatLng(46.483232,30.738147),t={center:n,zoom:16,mapTypeId:"roadmap",mapTypeControl:!1,scaleControl:!1,streetViewControl:!1,rotateControl:!1,fullscreenControl:!1};map=new google.maps.Map(document.getElementById("map"),t);map.data.loadGeoJson("/Home/GetGeoJson");map.addListener("click",function(n){placeMarkerAndPanTo(n.latLng,map)})}function placeMarkerAndPanTo(n,t){document.getElementById("input-position").value=n;marker.setMap(null);marker=new google.maps.Marker({position:n,map:t});showMarkers()}function saveMarker(){markers.push(marker);coordinatesForServer+=document.getElementById("input-position").value;document.getElementById("UpdateDiv").value=coordinatesForServer}function showMarkers(){for(var n=0;n<markers.length;n++)markers[n].setMap(map)}var map,marker=new google.maps.Marker,coordinatesForServer="",markers=[];google.maps.event.addDomListener(window,"load",initialize);